import {BrowserRouter as Router, Routes, Route} from "react-router-dom";



function App() {
  return (

      <Router>
        <Routes>
          <Route path="/" element={<Admin/>}/>
          <Route path="/login" element={<CadastrarAdmin/>}/>
          <Route path="/register" element={<EditarAdmin/>}/>
        </Routes>
    </Router>

  );
}

export default App;
